import React from 'react';
import { DropDown, DropDownItem, SearchStyles } from './styles/DropDown';

const Search = () => {
  console.log('blah');

  return (
    <SearchStyles>
      <div>
        <input type="search" />
      </div>
      <DropDown>
        <DropDownItem>Hey</DropDownItem>
      </DropDown>
    </SearchStyles>
  );
};

export default Search;
